import { Component } from "react";

export default class Navigation extends Component {
    render() {
        const { location } = this.props;
        const home = location.pathname === "/" ? "active" : "";
        const search = location.pathname.match(/^\/search/) ? "active" : "";
        const signinup = location.pathname.match(/^\/signup|/) ? "active" : "";

        return (
            <nav>
                <a class="a" href="/">Home</a>
                <a class="a" href="/search">Search</a>
                <a class="a" href="/signup">Sign Up/In</a>
            </nav>
        );
    }
}
